import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import './Profile.css';
import axios from 'axios';
import { useState } from 'react';


const getPersonByIdUrl = 'http://localhost:8080/api/persons/';

const Profile = (props) =>{
    const [dataProfile, setDataProfile] = useState([]);
    const id = props.data.token._id;
    
    const getData = async() => {
        await axios.get(getPersonByIdUrl + id)
        .then(response => {
            console.log("a")
            console.log(response.data);
            setDataProfile(response.data);
        })
        .catch(error => {
            console.log(error.data);
        })
    }


    return(
        
        <div>
            <Box
            component="form"
            sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
                }}
            noValidate
            autoComplete="off"
            ></Box>
            <h1>Profile</h1>
            <form className='profileForm'>
            <TextField
            required
            id="filled-required"
            label="FirstName"
            defaultValue="Hello World"
            variant="filled"
            />
            <TextField
            required
            id="filled-required"
            label="LastName"
            defaultValue="Hello World"
            variant="filled"
            />
            <TextField
            required
            id="filled-required"
            label="UserName"
            defaultValue="Hello World"
            variant="filled"
            />
            <TextField
            required
            id="filled-required"
            label="Password"
            defaultValue="Hello World"
            variant="filled"
            />
            <TextField
            required
            id="filled-required"
            label="Email"
            defaultValue="Hello World"
            variant="filled"
            />
            <TextField
            required
            id="filled-required"
            label="Address"
            defaultValue="Hello World"
            variant="filled"
            />
            </form>
            
        </div>
    )
}

export default Profile;
